import React from "react";

import Carousel from "react-bootstrap/Carousel";
import images1 from '../images/Muka1.jpg';
import images2 from '../images/muka2.jpg';
import images3 from '../images/muka3.jpg'

export default function CarouselBox (){

    return(
        <>
        <Carousel>
            <Carousel.Item>
                <img
                className={'d-block w-100'}
                src={images1}
                alt={'Img'}/>
                <Carousel.Caption>
                    <h1>Интернет магазин, созданный с помощью CMS 'Wordpress', где вы можете приобрести подарки на все праздники жизни!</h1>
                </Carousel.Caption>

            </Carousel.Item>
            <Carousel.Item>
                <img
                className={'d-block w-100'}
                src={images2}
                alt={'Img1'}/>

            </Carousel.Item>
            <Carousel.Item>
                <img
                    className={'d-block w-100'}
                    src={images3}
                    alt={'Img'}/>

            </Carousel.Item>
        </Carousel>
        </>
    );
}
